script: |
  super -f text -I q792.spq | sort > q792.out

inputs:
  - name: q792.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col1 NOT BETWEEN - col2 AND - 25 + ( - - 61 ) * + - 49 * - col2 + col0;
  - name: tab1

outputs:
  - name: q792.out
    data: |
      51	14	96
      85	5	59
      91	47	68
